import React from "react";
import Card from "react-bootstrap/Card";
import "./index.css";

const Profile = () => {
  return (
    <div className="mx-auto center">
      <Card className="my-5 p-5">
        <h1>Profile</h1>
      </Card>
    </div>
  );
};

export default Profile;
